import React, {Component} from 'react';
import products from '../products'

class Home extends Component{
    render() {
        const data = products.map(product => {
            return (
                <div className="mb-5" style={{width: "33%"}}>
                    <div className="card" style={{width: "18rem"}}>
                        <img className="card-img-top" src="..." alt="Card image cap"/>
                        <div className="card-body">
                            <h5 className="card-title">
                                <a href="#" style={{textDecoration: "none"}}>{product.name}</a>
                            </h5>
                            <small className="card-text">{product.brand}</small>
                            <br/>
                            <strong className="card-text">${product.price}</strong>
                            <p>{product.numberOfReviews}</p>
                        </div>
                    </div>
                </div>
            )
        })

        return (
            <div className="d-flex flex-wrap container mt-5" style={{flexWrap: "wrap"}}>
                {data}
            </div>
        )
    }
}

export default Home;
